ready(()=>{let t=document.querySelectorAll("[data-lazybg]"),e=new IntersectionObserver((t,e)=>{t.forEach(t=>{if(t.isIntersecting){let a=t.target;a.getAttribute("data-lazybg"),a.style.backgroundImage=a.getAttribute("data-lazybg"),a.removeAttribute("data-lazybg"),e.unobserve(a)}})},{root:null,rootMargin:"0px",threshold:0});t.forEach(t=>{e.observe(t)})});
